// ==UserScript==
// @name         老司机自动开车-115离线助手
// @namespace    115helper.for.insider
// @version      1.0
// @description  老司机自动开车-115离线助手, 自动抓取页面磁链同步至115离线
// @author       insider
// @require      http://libs.baidu.com/jquery/2.0.0/jquery.min.js
// @match       http://*/*
// @match       https://*/*
// @grant       GM_xmlhttpRequest
// @grant       GM_getValue
// @grant       GM_setValue
// @grant       GM_openInTab
// @run-at      document-end
// ==/UserScript==

if (location.host.indexOf('115.com') >= 0) {
    //115到此结束
    console.log('老司机自动开车-115离线助手 115域下不执行');
    return false;
}

var notification_url = ''; //chrome桌面通知默认点击跳转地址
var token_url = 'http://115.com/?ct=offline&ac=space&_='; //获取115 token接口
var lxURL = 'http://115.com/web/lixian/?ct=lixian&ac=add_task_url'; //添加115离线任务接口
var logininfo_url = "http://web.api.115.com/files"; //获取登陆态接口
var X_userID = 0; //默认115用户ID
GM_setValue('X_userID', X_userID);

//验证115登陆态. 并获取user_id
if (X_userID == '0') {
    
    GM_xmlhttpRequest({
        method: 'GET',
        url: logininfo_url + "?aid=1&cid=0&o=user_ptime&asc=0&offset=0&show_dir=1&limit=115&code=&scid=&snap=0&natsort=1&source=&format=json",
        onload: function (responseDetails)
        {
            var lxRs = JSON.parse(responseDetails.responseText); //登陆状态结果
            console.log(lxRs);
            if (lxRs.state) {
                //已登陆
                uid = lxRs.uid;
                GM_setValue(X_userID, uid);
                console.log('老司机自动开车-115离线助手 已登陆115, uid:'+uid);
            } else {
                //未登陆
                console.log('老司机自动开车-115离线助手 未登陆115');
                return nologin();
            }
        }
    });
    
}


//未登陆115处理方法
function nologin()
{ 
    notification_url = "http://115.com";
    notifiy("老司机自动开车-115离线助手",
            '上车前先登录115网盘哦,点击此登录,登录完成后刷新该页面!',
            'data:image/jpg;base64,',
            notification_url
           );
    GM_setValue('X_userID', '0');
    return false;

}

function notifiy(title, body, icon, click_url)
{

    var notification = new Notification(title,{
        body : body,
        icon :icon,
        tag : {}, // 可以加一个tag
        isClickable: true
    });

    notification.onshow = function () {
        setTimeout(function () {
            notification.close();
        }, 10000);
    };

    notification.onclick = function () {
        window.open(click_url);
    };


}
//添加115离线任务
function LXTo115(url)
{
    GM_xmlhttpRequest({
        method: 'GET',
        url: token_url + new Date().getTime(),
        onload: function (responseDetails)
        {
            if (responseDetails.responseText.indexOf('html') >= 0) {
                //未登录处理
                return nologin();
            }
            var sign115 = JSON.parse(responseDetails.response).sign;
            var time115 = JSON.parse(responseDetails.response).time;
            downTo115(url, X_userID, sign115, time115);
        }
    });
}

//POST提交下载任务
function downTo115(url, X_userID, sign115, time115) {


    GM_xmlhttpRequest({
        method: 'POST',
        url: lxURL,
        headers:{
            "Content-Type":"application/x-www-form-urlencoded"
        },
        data:"url="+encodeURIComponent(url)+"&uid="+X_userID+"&sign="+sign115+"&time="+time115,
        onload: function (responseDetails) {
            var lxRs = JSON.parse(responseDetails.responseText); //离线结果
            console.log(lxRs);
            if (lxRs.state) {
                //离线任务添加成功
                notification_url = "http://115.com/?tab=offline&mode=wangpan";
                notifiy("老司机自动开车-115离线助手",
                        '上车咯,点击进入网盘',
                        'data:image/jpg;base64,',
                        notification_url
                       );

            }

            console.log("磁链:"+url+" 下载结果:"+ lxRs.state);

        }
    });

}

//magnet判断
var magnets = $("body").html().match(/magnet:\?xt=urn:btih:[0-9a-zA-Z]{40}/g);
if(!magnets)
{
    console.log("页面无发现磁链");
    return false;
}

$.each(magnets, function(i, n){
    var magnet = n;
    console.log("发现磁链:"+magnet);
    LXTo115(magnet);

});



///* */